import React from "react";
import "../Styling/Day.scss";
const day = (props) => {
  const { dayData, onDaySelect } = props;
  const { id, text, value } = dayData;
  return (
    <div className="day">
      <div>text}</div>
      <div
        className={`circle ${value ? "active" : ""}`}
        onClick={() => {
          onDaySelect(id)
        }}
      ></div>
    </div>
  );
};

export default day;
